  useState[selectedCharacter, setSelectedCharacter] = useState({})

  console.log(user.characters)
  const userCharacterCards = (user.characters.map(character => <UserCharacterCard key={character.id} character={character}/>))

  return (
    <div>
    {userCharacterCards}
    </div>
  )
}

export default Account
